import{_ as e,o as a,c as i,d as p}from"./app.c489a0c5.js";const r={},d=p(`<h1 id="\u6240\u601D\u6240\u60F3" tabindex="-1"><a class="header-anchor" href="#\u6240\u601D\u6240\u60F3" aria-hidden="true">#</a> \u6240\u601D\u6240\u60F3</h1><p>\u8BB0\u5F55\u4E00\u4E0B\u5C06\u5F00\u53D1\u8FC7\u7A0B\u4E2D\u7684\u601D\u8003\u70B9\u6EF4</p><h2 id="\u6BCF\u65E5\u56DE\u987E" tabindex="-1"><a class="header-anchor" href="#\u6BCF\u65E5\u56DE\u987E" aria-hidden="true">#</a> \u6BCF\u65E5\u56DE\u987E</h2><p>\u300C\u4E00\u5348\u4E00\u62FE\u300D\u8FD9\u4E2A\u6A21\u5757\u7684\u8BDE\u751F\u6765\u81EA\u4E8E\u300A\u5361\u7247\u7B14\u8BB0\u5199\u4F5C\u6CD5\u300B\u4E2D\u5173\u4E8E\u5362\u66FC\u4F7F\u7528\u5361\u7247\u76D2\u7684\u4E00\u6BB5\u63CF\u8FF0\u3002\u91CC\u9762\u8BB2\u5230\u4ED6\u4F1A\u65F6\u4E0D\u65F6\u62FF\u51FA\u5361\u7247\u5BFB\u627E\u7075\u611F\u3002\u867D\u7136\u5728\u8FD9\u4E2A\u6A21\u5757\u4E2D\u5C55\u793A\u7684\u662F\u5212\u7EBF\u7B14\u8BB0\uFF0C\u4F46\u662F\u5176\u4E2D\u76F8\u4F3C\u70B9\u662F\uFF1A\u9700\u8981\u65F6\u4E0D\u65F6\u62FF\u51FA\u6765\uFF0C\u611F\u53D7\u4E00\u4E0B\u7B14\u8BB0\u80FD\u591F\u5E26\u6765\u7684\u7075\u611F\u3002\u4E4B\u524D\u5BF9\u4E8E\u4E00\u53E5\u8BDD\u6CA1\u6709\u592A\u591A\u7684\u60F3\u6CD5\uFF0C\u5E76\u4E0D\u4EE3\u8868\u7740\u4E4B\u540E\u4E0D\u4F1A\u6709\u60F3\u6CD5\u3002\u5728\u7ECF\u5386\u4E86\u4E00\u4E9B\u4E4B\u540E\uFF0C\u624D\u80FD\u5C06\u4E4B\u95F4\u6709\u6240\u611F\u89E6\u7684\u5185\u5BB9\u6C89\u6DC0\u4E0B\u6765\u3002</p><p>\u6240\u4EE5\u5728\u8FD9\u4E2A\u6A21\u5757\u7684\u529F\u80FD\u5B9A\u4F4D\u4E0A\uFF0C\u548C\u5176\u4ED6\u5E94\u7528\u7684\u6BCF\u65E5\u56DE\u987E\u6709\u6240\u533A\u522B\u3002</p><p>\u76F8\u6BD4\u4E8E\u5176\u4ED6\u7684\u5E94\u7528\uFF0C\u4ED6\u4EEC\u53EF\u80FD\u66F4\u52A0\u5173\u6CE8\u5728\u9057\u5FD8\u66F2\u7EBF\u4E0A\uFF0C\u901A\u8FC7\u6BCF\u65E5\u56DE\u987E\u7684\u65B9\u5F0F\uFF0C\u5C06\u5185\u5BB9\u4EE5\u4E0D\u540C\u7684\u9891\u6B21\u51FA\u73B0\u3002\u6211\u4E5F\u7EA0\u7ED3\u8FC7\u662F\u5426\u8981\u52A0\u5165\u76F8\u5173\u7684\u529F\u80FD\u3002\u4F46\u662F\u73B0\u5728\u7684\u51B3\u5B9A\u662F<strong>\u4E0D\u589E\u52A0\u7C7B\u4F3CAnki\u7684\u529F\u80FD</strong>\u3002\u56E0\u4E3A\u5E76\u4E0D\u662F\u6240\u6709\u7684\u7B14\u8BB0\u90FD\u9700\u8981\u53BB\u5F81\u670D\u9057\u5FD8\u66F2\u7EBF\u7684\uFF0C\u6709\u65F6\u4E0D\u7ECF\u610F\u7684\u5BDF\u89C9\u4F1A\u5E26\u6765\u66F4\u5F3A\u7684\u7075\u611F\u7206\u53D1\u3002\u4F46<strong>\u4F1A\u589E\u52A0\u5C06\u5185\u5BB9\u5BFC\u51FA\u5230\u7C7BAnki\u7684\u5E94\u7528\u4E2D\u7684\u529F\u80FD</strong>\u3002</p><h2 id="\u95EA\u5FF5\u5361\u7247\u76D2" tabindex="-1"><a class="header-anchor" href="#\u95EA\u5FF5\u5361\u7247\u76D2" aria-hidden="true">#</a> \u95EA\u5FF5\u5361\u7247\u76D2</h2><p>\u300C\u95EA\u5FF5\u5361\u7247\u76D2\u300D\u8FD9\u4E2A\u6A21\u5757\u7684\u8BDE\u751F\u6765\u81EA\u4E8E\u300A\u5361\u7247\u7B14\u8BB0\u5199\u4F5C\u6CD5\u300B\u4E2D\u5173\u4E8E\u5BF9\u5362\u66FC\u5199\u4F5C\u6D41\u7A0B\u4E2D\u7684\u63CF\u8FF0\u3002\u91CC\u9762\u8BB2\u5230\u5728\u8BB0\u5F55\u4E86\u95EA\u5FF5\u7B14\u8BB0\u548C\u6587\u732E\u7B14\u8BB0\u540E\uFF0C\u9700\u8981\u4ED4\u7EC6\u9605\u8BFB\u8BB0\u5F55\u7684\u524D\u4E24\u79CD\u7B14\u8BB0\uFF0C\u6700\u597D\u6BCF\u5929\u4E00\u6B21\uFF0C\u4EE5\u53CA\u5728\u4F60\u5F00\u59CB\u9057\u5FD8\u4E4B\u524D\uFF0C\u5E76\u601D\u8003\u5B83\u4EEC\u548C\u4F60\u601D\u8003\u7684\u5185\u5BB9\u7684\u5173\u8054\u5173\u7CFB\u3002\u6240\u4EE5\u5C06\u6240\u6709\u7684\u6700\u8FD1\u6DFB\u52A0\u7684\u95EA\u5FF5\u7B14\u8BB0\u63D0\u53D6\u4E86\u51FA\u6765\uFF0C\u805A\u96C6\u5728\u4E00\u4E2A\u5355\u72EC\u7684\u9875\u9762\u4E2D\u3002\u5E76\u4E14\u53EF\u4EE5\u9009\u62E9\u6700\u8FD17\u5929\u300130\u5929\u7B49\u3002</p><p>\u5982\u679C\u95EA\u5FF5\u7B14\u8BB0\u5904\u7406\u5B8C\u4E86\uFF0C\u53EF\u4EE5\u8FDB\u884C\u5F52\u6863\u3002\u5982\u679C\u9009\u62E9\u4E86\u5220\u9664\uFF0C\u4F1A\u5728\u4E0B\u4E00\u6B21\u540C\u6B65\u65F6\u518D\u4E00\u6B21\u540C\u6B65\u8FDB\u6765\u3002</p><p>\u5F53\u65F6\u6709\u7EA0\u7ED3\u4E00\u4E2A\u70B9\uFF1A\u5728\u95EA\u5FF5\u5361\u7247\u76D2\u4E2D\u662F\u5426\u9700\u8981\u5305\u542B\u5212\u7EBF\u7684\u7B14\u8BB0\uFF1F</p><p>\u7EA0\u7ED3\u4E86\u8BB8\u4E45\uFF0C\u6700\u7EC8\u6CA1\u6709\u653E\u5165\u8FDB\u6765\uFF0C\u539F\u56E0\u662F\uFF1A</p><ul><li>\u5212\u7EBF\u7B14\u8BB0\u662F\u5C5E\u4E8E\u539F\u6587\uFF0C\u5E76\u4E0D\u662F\u4F60\u4ECE\u4E2D\u6709\u611F\u800C\u53D1\u7684\u70B9\uFF0C\u6709\u89E6\u52A8\u4F46\u6CA1\u6709\u5B8C\u5168\u5185\u5316\u3002</li><li>\u5212\u7EBF\u7B14\u8BB0\u4F1A\u5728\u6BCF\u65E5\u56DE\u987E\uFF08\u4E00\u5348\u4E00\u62FE\uFF09\u7684\u6A21\u5757\u4E2D\u968F\u673A\u51FA\u73B0\uFF0C\u7B49\u540E\u7EED\u4EA7\u751F\u51FA\u65B0\u7684\u706B\u82B1\u540E\uFF0C\u6C89\u6DC0\u4E0B\u6765\u7684\u624D\u80FD\u4F5C\u4E3A\u95EA\u5FF5\u7B14\u8BB0\u751A\u81F3\u662F\u6C38\u4E45\u7B14\u8BB0\u3002</li><li>\u95EA\u5FF5\u7B14\u8BB0\u57FA\u672C\u6765\u6E90\u4E8E\u5728\u7B2C\u4E09\u65B9\u8F6F\u4EF6\u4E2D\u8BB0\u5F55\u4E0B\u6765\u7684\u5185\u5BB9\uFF0C\u662F\u788E\u7247\u5316\u7075\u611F\u7684\u8FF8\u53D1\uFF0C\u9700\u8981\u5C3D\u5FEB\u8FDB\u884C\u5904\u7406\u3002\u800C\u5212\u7EBF\u7B14\u8BB0\u66F4\u50CF\u662F\u91CD\u70B9\uFF0C\u9700\u8981\u5728\u7EDF\u89C8\u6574\u672C\u4E66\u7684\u65F6\u5019\u8D77\u5230\u63D0\u7EB2\u6308\u9886\u7684\u4F5C\u7528\u3002</li></ul><h2 id="\u65B9\u6CD5\u8BBA" tabindex="-1"><a class="header-anchor" href="#\u65B9\u6CD5\u8BBA" aria-hidden="true">#</a> \u65B9\u6CD5\u8BBA</h2><p>\u7F51\u4E0A\u6D41\u4F20\u7684\u65B9\u6CD5\u8BBA\u90FD\u5F88\u597D\uFF0C\u4F46\u662F\u5173\u952E\u9700\u8981\u4F7F\u7528\u8D77\u6765\u3002</p><h3 id="\u5361\u7247\u76D2\u7B14\u8BB0\u6CD5" tabindex="-1"><a class="header-anchor" href="#\u5361\u7247\u76D2\u7B14\u8BB0\u6CD5" aria-hidden="true">#</a> \u5361\u7247\u76D2\u7B14\u8BB0\u6CD5</h3><p>\u4ECE\u4E66\u672C\u4ECB\u7ECD\u7684\u5362\u66FC\u5C06\u7B14\u8BB0\u5206\u6210\u4E86\u95EA\u5FF5\u7B14\u8BB0\u3001\u6587\u732E\u7B14\u8BB0\u548C\u6C38\u4E45\u7B14\u8BB0\u3002</p><p>\u5176\u4E2D\u95EA\u5FF5\u7B14\u8BB0\u548C\u6587\u732E\u7B14\u8BB0\u662F\u8FC7\u6E21\u7528\u7684\uFF0C\u6700\u7EC8\u603B\u7ED3\u6210\u4E3A\u6C38\u4E45\u7B14\u8BB0\u653E\u5165\u6C38\u4E45\u7B14\u8BB0\u76D2\u4E2D\u3002</p><p>\u5176\u4E2D\u611F\u53D7\u6700\u6DF1\u7684\u662F\uFF1A\u6BCF\u4E00\u6B21\u6DFB\u52A0\u7B14\u8BB0\u90FD\u662F\u5BF9\u7B14\u8BB0\u76D2\u7684\u590D\u76D8\uFF0C\u5BFB\u627E\u548C\u5F53\u524D\u7B14\u8BB0\u5173\u8054\u7684\u6240\u6709\u7B14\u8BB0\u3002</p><p>\u540C\u65F6\u5BF9\u4E8E\u552F\u4E00\u6807\u8BC6\u7684\u4F7F\u7528\u975E\u5E38\u5DE7\u5999\u3002\u901A\u8FC7\u7B14\u8BB0\u540E\u8DDF\u7740\u7684\u6570\u5B57\u6216\u8005\u5B57\u6BCD\u6765\u533A\u5206\u5F53\u524D\u7B14\u8BB0\u4E0E\u5176\u4ED6\u5173\u8054\u7B14\u8BB0\u4E4B\u95F4\u601D\u8003\u7EF4\u5EA6\u4E0A\u7684\u533A\u5206\u3002 \u5728\u4F7F\u7528\u4E0A\u4E00\u76EE\u4E86\u7136\u3002</p><h3 id="ria\u7B14\u8BB0\u6CD5" tabindex="-1"><a class="header-anchor" href="#ria\u7B14\u8BB0\u6CD5" aria-hidden="true">#</a> RIA\u7B14\u8BB0\u6CD5</h3><p>\u6838\u5FC3\u662F\u7ED3\u5408\u81EA\u5DF1\u63D0\u70BC\u51FA\u6848\u4F8B\u5E93\u548C\u884C\u52A8\u5E93\u3002</p><p>\u63A8\u8350\u62C6\u4E66\u5E2E\u5728B\u7AD9\u7684\u89C6\u9891\uFF0C\u4E5F\u63A8\u8350\u8D75\u5468\u8001\u5E08\u7684\u300A\u8FD9\u6837\u8BFB\u4E66\u5C31\u591F\u4E86\u300B\u3002</p><p>\u6211\u6B63\u5728\u4ECE\u4E0A\u9762\u7684\u8FD9\u4E24\u4E2A\u9014\u5F84\u5438\u6536\u4E00\u4E9B\u5173\u4E8E\u62C6\u4E66\u7684\u65B9\u6CD5\u8BBA\uFF0C\u5E76\u601D\u8003\u5982\u4F55\u7ED3\u5408\u5230\u8F6F\u4EF6\u5F53\u4E2D\u3002</p><h3 id="\u5173\u4E8E\u7528\u81EA\u5DF1\u7684\u8BDD" tabindex="-1"><a class="header-anchor" href="#\u5173\u4E8E\u7528\u81EA\u5DF1\u7684\u8BDD" aria-hidden="true">#</a> \u5173\u4E8E\u7528\u81EA\u5DF1\u7684\u8BDD</h3><p>\u5F88\u591A\u65B9\u6CD5\u8BBA\u4E2D\u90FD\u63D0\u53CA\u4E86\u8981\u7528\u81EA\u5DF1\u7684\u8BDD\u6765\u603B\u7ED3\u6587\u4E2D\u8981\u70B9\u3002</p><p>\u4F46\u662F\u4E2A\u4EBA\u611F\u89C9\u662F\uFF1A<code>\u7406\u89E3\u7684\u8868\u8C61\u662F\u7528\u81EA\u5DF1\u7684\u8BDD\u8868\u8FF0\uFF0C\u7528\u81EA\u5DF1\u7684\u8BDD\u8868\u8FF0\u4E0D\u7B49\u4E8E\u7406\u89E3\u4E86\u5185\u5BB9</code>\u3002</p><p>\u662F\u5426\u9700\u8981\u901A\u8FC7\u81EA\u5DF1\u7684\u8BDD\u6765\u590D\u8FF0\u89C2\u70B9\uFF1A</p><ul><li>\u5982\u679C\u5F53\u524D\u89C2\u70B9\u548C\u81EA\u5DF1\u7684\u67D0\u4E00\u4E2A\u60F3\u6CD5\u5173\u8054\uFF0C\u90A3\u80AF\u5B9A\u5F97\u7528\u81EA\u5DF1\u7684\u8BDD\u8868\u8FF0</li><li>\u5982\u679C\u5F53\u524D\u89C2\u70B9\u548C\u81EA\u5DF1\u7684\u67D0\u4E2A\u7ECF\u5386\u6709\u89E6\u52A8\uFF0C\u90A3\u80AF\u5B9A\u53EF\u4EE5\u6709\u81EA\u5DF1\u7684\u60F3\u6CD5\u5199\u51FA\u6765</li><li>\u5982\u679C\u5F53\u524D\u89C2\u70B9\u662F\u4E00\u4E2A\u65B0\u7684\u89C2\u70B9\uFF0C\u53EA\u80FD\u7167\u732B\u753B\u864E\u5730\u590D\u8FF0\u6CA1\u6709\u4EF7\u503C\u3002\u8FD8\u4E0D\u5982\u8BB0\u5F55\u539F\u6587\uFF0C\u53CD\u590D\u5480\u56BC\u3002\u7B49\u6709\u81EA\u5DF1\u60F3\u6CD5\u65F6\u518D\u8FDB\u884C\u590D\u8FF0\u548C\u63D0\u70BC\u3002</li></ul><h2 id="\u6570\u636E\u7EDF\u8BA1" tabindex="-1"><a class="header-anchor" href="#\u6570\u636E\u7EDF\u8BA1" aria-hidden="true">#</a> \u6570\u636E\u7EDF\u8BA1</h2><p>\u6700\u8FD1\u4E0A\u4E86\u4E00\u4E2A\u53EB\u4E03\u65E5\u70ED\u529B\u56FE\u7684\u6A21\u5757\uFF0C\u53EF\u4EE5\u5C55\u793A\u6700\u8FD1\u4E03\u5929\u5185\u5212\u7EBF\u7B14\u8BB0\u7684\u6570\u91CF\u3002\u7C7B\u4F3C\u8FD9\u6837\u7684\u7EDF\u8BA1\u7684\u529F\u80FD\u5728\u8BBE\u8BA1\u7B79\u5907\u9636\u6BB5\uFF0C\u672C\u6765\u60F3\u65B0\u589E\u9875\u9762\u505A\u7684\uFF0C\u4F46\u662F\u53D1\u73B0\u82F9\u679CiOS16\u6709\u81EA\u5DF1\u7684\u56FE\u8868\u7EC4\u4EF6\u5E93\uFF0C\u6253\u7B97\u5728\u8FD9\u4E2A\u6846\u67B6Release\u540E\uFF0C\u518D\u5F00\u53D1\u76F8\u5173\u7684\u529F\u80FD\u3002</p><p><strong>\u5982\u679C\u6709\u7EDF\u8BA1\u7684\u529F\u80FD\u8BC9\u6C42\uFF0C\u53EF\u4EE5\u5728github\u7684issue\u4E2D\u63D0\u51FA\u3002</strong></p><h2 id="\u7B14\u8BB0\u7C7B\u578B" tabindex="-1"><a class="header-anchor" href="#\u7B14\u8BB0\u7C7B\u578B" aria-hidden="true">#</a> \u7B14\u8BB0\u7C7B\u578B</h2><p>\u805A\u5408\u4ECEiBooks\u548C\u5FAE\u4FE1\u8BFB\u4E66\u4E2D\u7684\u7B14\u8BB0\u7C7B\u578B\uFF0C\u4E3B\u8981\u5206\u6210\u4E86\u4E24\u7C7B\uFF1A\u5212\u7EBF\u548C\u4E66\u7B7E\u3002</p><p>\u4ECE\u8FD9\u4E24\u4E2A\u7C7B\u578B\u7684\u4F7F\u7528\u65B9\u5F0F\u7684\u7406\u89E3\uFF1A</p><p><strong>\u5212\u7EBF</strong></p><p>\u5212\u7EBF\u9AD8\u4EAE\u7684\u90E8\u5206\u3002</p><p>\u4E0D\u540C\u7684\u989C\u8272\u53EF\u4EE5\u6709\u4E0D\u540C\u7684\u542B\u4E49\u3002</p><p>\u4EE5\u6211\u81EA\u8EAB\u4F7F\u7528\u4E3A\u4F8B\u3002</p><p>\u5728\u5FAE\u4FE1\u8BFB\u4E66\u4E2D</p><ul><li>\u9EC4\u7EBF - \u8981\u70B9\u3001\u89C2\u70B9</li><li>\u76F4\u7EBF - \u4E66\u4E2D\u63D0\u51FA\u7684\u4E00\u4E2A\u95EE\u9898 <ul><li>\u4EC0\u4E48\u662F\u5361\u7247\u76D2\u7B14\u8BB0\u6CD5</li><li>\u4EC0\u4E48\u662F\u95EA\u5FF5\u7B14\u8BB0</li></ul></li><li>\u6CE2\u6D6A\u7EBF - \u5BF9\u4E0A\u9762\u95EE\u9898\u7684\u56DE\u7B54 <ul><li>\u5C06\u7B14\u8BB0\u4EE5\u5361\u7247\u7684\u5F62\u5F0F\u653E\u5728\u4E00\u4E2A\u76D2\u5B50\u4E2D</li></ul></li></ul><p><strong>\u4E66\u7B7E</strong></p><p>\u57FA\u672C\u6CA1\u6709\u7528\u5230\u3002\u6309\u7167\u6211\u7684\u7406\u89E3\u662F\u4E66\u672C\u7684\u6298\u89D2\uFF0C\u610F\u5473\u7740\uFF1A</p><ul><li>\u8FD9\u4E00\u9875\u7684\u5185\u5BB9\u9700\u8981\u53CD\u590D\u9605\u8BFB</li><li>\u8FD9\u4E00\u9875\u7684\u5185\u5BB9\u9700\u8981\u5728\u62FF\u5230\u4E66\u672C\u540E\u5FEB\u901F\u627E\u5230</li><li>\u8FD9\u4E00\u9875\u7684\u5185\u5BB9\u90FD\u5F88\u91CD\u8981</li></ul><p>\u65E0\u8BBA\u662F\u4E0A\u8FF0\u54EA\u4E00\u79CD\u542B\u4E49\uFF0C\u90FD\u9700\u8981\u5FEB\u901F\u5B9A\u4F4D\u5230\u4E66\u7B7E\u5BF9\u5E94\u7684\u4F4D\u7F6E\u3002\u4F46\u662F\u56E0\u4E3A\u7535\u5B50\u4E66\u9605\u8BFB\u548C\u7B14\u8BB0\u7684\u4E60\u60EF\u4E0E\u7EB8\u8D28\u4E66\u5B58\u5728\u4F7F\u7528\u4E0A\u7684\u5DEE\u5F02\u3002</p><p>\u5BF9\u4E8E\u7535\u5B50\u4E66\u800C\u8A00\uFF0C\u53EA\u80FD\u901A\u8FC7\u5355\u72EC\u4E00\u4E2A\u9875\u9762\u805A\u5408\u5C55\u793A\u6240\u6709\u7684\u4E66\u7B7E\uFF0C\u518D\u8FDB\u884C\u5FEB\u901F\u5B9A\u4F4D\u3002\u8FD9\u4E2A\u4E0E\u62FF\u5230\u4E66\u901A\u8FC7\u6298\u89D2\u5FEB\u901F\u5B9A\u4F4D\u7684\u4F7F\u7528\u89C2\u611F\u4E0A\u5B58\u5728\u4E0D\u5C11\u5DEE\u8DDD\u3002</p><p>\u540E\u6765\u56E0\u4E3A\u4E66\u4E2D\u65F6\u5E38\u6709\u4E0D\u5C11\u63D2\u56FE\u7684\u90E8\u5206\uFF0C\u4F46\u662F\u65E0\u8BBA\u54EA\u4E00\u65B9\uFF0C\u5BF9\u4E8E\u63D2\u56FE\u7684\u5BFC\u5165\u90FD\u662F\u4E0D\u652F\u6301\u7684\uFF0C\u8981\u4E48\u6CA1\u6709\u6570\u636E\uFF0C\u8981\u4E48\u7ED9\u4E86\u63D2\u56FE\u4E8C\u5B57\u3002\u6240\u4EE5\u4E3A\u4E86\u80FD\u8BA9\u56FE\u7247\u6B63\u5E38\u5C55\u793A\u5230\u7B14\u8BB0\u5217\u8868\u4E2D\uFF0C\u589E\u52A0\u4E86\u56FE\u7247\u7C7B\u578B</p><p><strong>\u56FE\u7247</strong></p><p>\u4E3B\u8981\u4E3A\u4E86\u5E94\u5BF9\u4E66\u672C\u4E2D\u56FE\u7247\u8981\u5212\u91CD\u70B9\u7684\u60C5\u51B5\u3002</p><p>\u64CD\u4F5C\u4E0A\u7B14\u8BB0\u7E41\u7410\uFF0C\u9700\u8981\u5B9A\u4F4D\u5230\u56FE\u7247\u7684\u4F4D\u7F6E\uFF0C\u518D\u7F16\u8F91\u7B14\u8BB0\u3002</p><p>\u5177\u4F53\u64CD\u4F5C\u53EF\u4EE5\u770B\u4E0B\u300C\u6307\u5357-\u9AD8\u4EAE\u7B14\u8BB0-\u5982\u4F55\u7F16\u8F91\u7B14\u8BB0\u300D\u4E2D\u7684\u5185\u5BB9\u3002</p><h2 id="\u8BB0\u5728\u6700\u540E" tabindex="-1"><a class="header-anchor" href="#\u8BB0\u5728\u6700\u540E" aria-hidden="true">#</a> \u8BB0\u5728\u6700\u540E</h2><p>\u4EE5\u674E\u7B11\u6765\u8001\u5E08\u300A\u628A\u65F6\u95F4\u5F53\u505A\u670B\u53CB\u300B\u7684\u4E00\u53E5\u8BDD\u4F5C\u4E3A\u8B66\u793A\u548C\u4E92\u52C9\uFF1A</p><div class="language-text ext-text line-numbers-mode"><pre class="language-text"><code>\u7EC8\u65E5\u4E0D\u5FD8\u5BFB\u627E\u6377\u5F84\uFF0C\u7F8E\u5176\u540D\u66F0\u201C\u63D0\u9AD8\u6548\u7387\u201D\uFF0C\u800C\u5B9E\u9645\u4E0A\u5374\u60F3\u7740\u201C\u6700\u597D\u4E0D\u8D39\u5439\u7070\u4E4B\u529B\u201D\u3002
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><p>\u4E16\u4E0A\u4F20\u8BF4\u7684\u6377\u5F84\u6709\u5343\u767E\u6761\uFF0C\u53EF\u8FDC\u89C2\uFF0C\u53EF\u5B66\u4E60\uFF0C\u4E0D\u53EF\u6D45\u5C1D\u8F84\u6B62\u3002</p><p>\u6B64\u5E94\u7528\u5E76\u4E0D\u662F\u9605\u8BFB\u7684\u6377\u5F84\uFF0C\u800C\u662F\u5E0C\u671B\u5E2E\u52A9\u5728\u9605\u8BFB\u4E2D\u601D\u8003\u7684\u62FE\u8D1D\u8005 \u{1F603}\u3002</p>`,55),l=[d];function n(h,t){return a(),i("div",null,l)}var c=e(r,[["render",n],["__file","index.html.vue"]]);export{c as default};
